// --- atf_exp.FDb.proc.Alloc
// Allocate memory for new default row.
// If out of memory, process is killed.
atf_exp::FProc& atf_exp::proc_Alloc() {
    atf_exp::FProc* row = proc_AllocMaybe();
    if (UNLIKELY(row == NULL)) {
        FatalErrorExit("atf_exp.out_of_mem  field:atf_exp.FDb.proc  comment:'Alloc failed'");
    }
    return *row;
}

// --- atf_exp.FDb.proc.AllocMaybe
// Allocate memory for new element. If out of memory, return NULL.
atf_exp::FProc* atf_exp::proc_AllocMaybe() {
    atf_exp::FProc *row = (atf_exp::FProc*)proc_AllocMem();
    if (row) {
        new (row) atf_exp::FProc; // call constructor
    }
    return row;
}

// --- atf_exp.FDb.proc.InsertMaybe
// Create new row from struct.
// Return pointer to new element, or NULL if insertion failed (due to out-of-memory, duplicate key, etc)
atf_exp::FProc* atf_exp::proc_InsertMaybe(const atf_exp::Proc &value) {
    atf_exp::FProc *row = &proc_Alloc(); // if out of memory, process dies. if input error, return NULL.
    proc_CopyIn(*row,const_cast<atf_exp::Proc&>(value));
    bool ok = proc_XrefMaybe(*row); // this may return false
    if (!ok) {
        proc_Delete(*row); // delete offending row, any existing xrefs are cleared
        row = NULL; // forget this ever happened
    }
    return row;
}

// --- atf_exp.FDb.proc.Delete
// Remove row from all global and cross indices, then deallocate row
void atf_exp::proc_Delete(atf_exp::FProc &row) {
    row.~FProc();
    proc_FreeMem(row);
}

// --- atf_exp.FDb.proc.AllocMem
// Allocate space for one element
// If no memory available, return NULL.
void* atf_exp::proc_AllocMem() {
    atf_exp::FProc *row = _db.proc_free;
    if (UNLIKELY(!row)) {
        proc_Reserve(1);
        row = _db.proc_free;
    }
    if (row) {
        _db.proc_free = row->proc_next;
    }
    return row;
}

// --- atf_exp.FDb.proc.FreeMem
// Remove mem from all global and cross indices, then deallocate mem
void atf_exp::proc_FreeMem(atf_exp::FProc &row) {
    if (UNLIKELY(row.proc_next != (atf_exp::FProc*)-1)) {
        FatalErrorExit("atf_exp.tpool_double_delete  pool:atf_exp.FDb.proc  comment:'double deletion caught'");
    }
    row.proc_next = _db.proc_free; // insert into free list
    _db.proc_free  = &row;
}

// --- atf_exp.FDb.proc.Reserve
// Preallocate memory for N more elements
// Return number of elements actually reserved.
u64 atf_exp::proc_Reserve(u64 n_elems) {
    u64 ret = 0;
    while (ret < n_elems) {
        u64 size = _db.proc_blocksize; // underlying allocator is probably Lpool
        u64 reserved = proc_ReserveMem(size);
        ret += reserved;
        if (reserved == 0) {
            break;
        }
    }
    return ret;
}

// --- atf_exp.FDb.proc.ReserveMem
// Allocate block of given size, break up into small elements and append to free list.
// Return number of elements reserved.
u64 atf_exp::proc_ReserveMem(u64 size) {
    u64 ret = 0;
    if (size >= sizeof(atf_exp::FProc)) {
        atf_exp::FProc *mem = (atf_exp::FProc*)algo_lib::malloc_AllocMem(size);
        ret = mem ? size / sizeof(atf_exp::FProc) : 0;
        // add newly allocated elements to the free list;
        for (u64 i=0; i < ret; i++) {
            mem[i].proc_next = _db.proc_free;
            _db.proc_free = mem+i;
        }
    }
    return ret;
}

// --- atf_exp.FDb.proc.XrefMaybe
// Insert row into all appropriate indices. If error occurs, store error
// in algo_lib::_db.errtext and return false. Caller must Delete or Unref such row.
bool atf_exp::proc_XrefMaybe(atf_exp::FProc &row) {
    bool retval = true;
    (void)row;
    // insert proc into index ind_proc
    if (true) { // user-defined insert condition
        bool success = ind_proc_InsertMaybe(row);
        if (UNLIKELY(!success)) {
            ch_RemoveAll(algo_lib::_db.errtext);
            algo_lib::_db.errtext << "atf_exp.duplicate_key  xref:atf_exp.FDb.ind_proc"; // check for duplicate key
            return false;
        }
    }
    // insert proc into index zd_proc
    if (true) { // user-defined insert condition
        zd_proc_Insert(row);
    }
    return retval;
}

