// --- atf_exp.FDb.ind_proc.GetOrCreate
// Find row by key. If not found, create and x-reference a new row with with this key.
atf_exp::FProc& atf_exp::ind_proc_GetOrCreate(const algo::strptr& key) {
    atf_exp::FProc* ret = ind_proc_Find(key);
    if (!ret) { //  if memory alloc fails, process dies; if insert fails, function returns NULL.
        ret         = &proc_Alloc();
        (*ret).proc = key;
        bool good = proc_XrefMaybe(*ret);
        if (!good) {
            proc_Delete(*ret); // delete offending row, any existin xrefs are cleared
            ret = NULL;
        }
    }
    vrfy(ret, tempstr() << "atf_exp.create_error  table:ind_proc  key:'"<<key<<"'  comment:'bad xref'");
    return *ret;
}

// --- atf_exp.FDb.ind_proc.InsertMaybe
// Insert row into hash table. Return true if row is reachable through the hash after the function completes.
bool atf_exp::ind_proc_InsertMaybe(atf_exp::FProc& row) {
    bool retval = true; // if already in hash, InsertMaybe returns true
    if (LIKELY(row.ind_proc_next == (atf_exp::FProc*)-1)) {// check if in hash already
        row.ind_proc_hashval = algo::Smallstr50_Hash(0, row.proc);
        ind_proc_Reserve(1);
        u32 index = row.ind_proc_hashval & (_db.ind_proc_buckets_n - 1);
        atf_exp::FProc* *prev = &_db.ind_proc_buckets_elems[index];
        do {
            atf_exp::FProc* ret = *prev;
            if (!ret) { // exit condition 1: reached the end of the list
                break;
            }
            if ((*ret).proc == row.proc) { // exit condition 2: found matching key
                retval = false;
                break;
            }
            prev = &ret->ind_proc_next;
        } while (true);
        if (retval) {
            row.ind_proc_next = *prev;
            _db.ind_proc_n++;
            *prev = &row;
        }
    }
    return retval;
}

// --- atf_exp.FDb.ind_proc.Remove
// Remove reference to element from hash index. If element is not in hash, do nothing
void atf_exp::ind_proc_Remove(atf_exp::FProc& row) {
    if (LIKELY(row.ind_proc_next != (atf_exp::FProc*)-1)) {// check if in hash already
        u32 index = row.ind_proc_hashval & (_db.ind_proc_buckets_n - 1);
        atf_exp::FProc* *prev = &_db.ind_proc_buckets_elems[index]; // addr of pointer to current element
        while (atf_exp::FProc *next = *prev) {                          // scan the collision chain for our element
            if (next == &row) {        // found it?
                *prev = next->ind_proc_next; // unlink (singly linked list)
                _db.ind_proc_n--;
                row.ind_proc_next = (atf_exp::FProc*)-1;// not-in-hash
                break;
            }
            prev = &next->ind_proc_next;
        }
    }
}

// --- atf_exp.FDb.ind_proc.Reserve
// Reserve enough room in the hash for N more elements. Return success code.
void atf_exp::ind_proc_Reserve(int n) {
    ind_proc_AbsReserve(_db.ind_proc_n + n);
}

// --- atf_exp.FDb.ind_proc.AbsReserve
// Reserve enough room for exacty N elements. Return success code.
void atf_exp::ind_proc_AbsReserve(int n) {
    u32 old_nbuckets = _db.ind_proc_buckets_n;
    u32 new_nelems   = n;
    // # of elements has to be roughly equal to the number of buckets
    if (new_nelems > old_nbuckets) {
        int new_nbuckets = i32_Max(algo::BumpToPow2(new_nelems), u32(4));
        u32 old_size = old_nbuckets * sizeof(atf_exp::FProc*);
        u32 new_size = new_nbuckets * sizeof(atf_exp::FProc*);
        // allocate new array. we don't use Realloc since copying is not needed and factor of 2 probably
        // means new memory will have to be allocated anyway
        atf_exp::FProc* *new_buckets = (atf_exp::FProc**)algo_lib::malloc_AllocMem(new_size);
        if (UNLIKELY(!new_buckets)) {
            FatalErrorExit("atf_exp.out_of_memory  field:atf_exp.FDb.ind_proc");
        }
        memset(new_buckets, 0, new_size); // clear pointers
        // rehash all entries
        for (int i = 0; i < _db.ind_proc_buckets_n; i++) {
            atf_exp::FProc* elem = _db.ind_proc_buckets_elems[i];
            while (elem) {
                atf_exp::FProc &row        = *elem;
                atf_exp::FProc* next       = row.ind_proc_next;
                u32 index          = row.ind_proc_hashval & (new_nbuckets-1);
                row.ind_proc_next     = new_buckets[index];
                new_buckets[index] = &row;
                elem               = next;
            }
        }
        // free old array
        algo_lib::malloc_FreeMem(_db.ind_proc_buckets_elems, old_size);
        _db.ind_proc_buckets_elems = new_buckets;
        _db.ind_proc_buckets_n = new_nbuckets;
    }
}

// --- atf_exp.FDb.zd_proc.Insert
// Insert row into linked list. If row is already in linked list, do nothing.
void atf_exp::zd_proc_Insert(atf_exp::FProc& row) {
    if (!zd_proc_InLlistQ(row)) {
        atf_exp::FProc* old_tail = _db.zd_proc_tail;
        row.zd_proc_next = NULL;
        row.zd_proc_prev = old_tail;
        _db.zd_proc_tail = &row;
        atf_exp::FProc **new_row_a = &old_tail->zd_proc_next;
        atf_exp::FProc **new_row_b = &_db.zd_proc_head;
        atf_exp::FProc **new_row = old_tail ? new_row_a : new_row_b;
        *new_row = &row;
        _db.zd_proc_n++;
    }
}

// --- atf_exp.FDb.zd_proc.Remove
// Remove element from index. If element is not in index, do nothing.
void atf_exp::zd_proc_Remove(atf_exp::FProc& row) {
    if (zd_proc_InLlistQ(row)) {
        atf_exp::FProc* old_head       = _db.zd_proc_head;
        (void)old_head; // in case it's not used
        atf_exp::FProc* prev = row.zd_proc_prev;
        atf_exp::FProc* next = row.zd_proc_next;
        // if element is first, adjust list head; otherwise, adjust previous element's next
        atf_exp::FProc **new_next_a = &prev->zd_proc_next;
        atf_exp::FProc **new_next_b = &_db.zd_proc_head;
        atf_exp::FProc **new_next = prev ? new_next_a : new_next_b;
        *new_next = next;
        // if element is last, adjust list tail; otherwise, adjust next element's prev
        atf_exp::FProc **new_prev_a = &next->zd_proc_prev;
        atf_exp::FProc **new_prev_b = &_db.zd_proc_tail;
        atf_exp::FProc **new_prev = next ? new_prev_a : new_prev_b;
        *new_prev = prev;
        _db.zd_proc_n--;
        row.zd_proc_next=(atf_exp::FProc*)-1; // not-in-list
    }
}

// --- atf_exp.FDb.zd_proc.RemoveAll
// Empty the index. (The rows are not deleted)
void atf_exp::zd_proc_RemoveAll() {
    atf_exp::FProc* row = _db.zd_proc_head;
    _db.zd_proc_head = NULL;
    _db.zd_proc_tail = NULL;
    _db.zd_proc_n = 0;
    while (row) {
        atf_exp::FProc* row_next = row->zd_proc_next;
        row->zd_proc_next  = (atf_exp::FProc*)-1;
        row->zd_proc_prev  = NULL;
        row = row_next;
    }
}

// --- atf_exp.FDb.zd_proc.RemoveFirst
// If linked list is empty, return NULL. Otherwise unlink and return pointer to first element.
atf_exp::FProc* atf_exp::zd_proc_RemoveFirst() {
    atf_exp::FProc *row = NULL;
    row = _db.zd_proc_head;
    if (row) {
        atf_exp::FProc *next = row->zd_proc_next;
        _db.zd_proc_head = next;
        atf_exp::FProc **new_end_a = &next->zd_proc_prev;
        atf_exp::FProc **new_end_b = &_db.zd_proc_tail;
        atf_exp::FProc **new_end = next ? new_end_a : new_end_b;
        *new_end = NULL;
        _db.zd_proc_n--;
        row->zd_proc_next = (atf_exp::FProc*)-1; // mark as not-in-list
    }
    return row;
}

// --- atf_exp.FDb.cd_proc_read.Insert
// Insert row into linked list. If row is already in linked list, do nothing.
void atf_exp::cd_proc_read_Insert(atf_exp::FProc& row) {
    if (!cd_proc_read_InLlistQ(row)) {
        if (_db.cd_proc_read_head) {
            row.cd_proc_read_next = _db.cd_proc_read_head;
            row.cd_proc_read_prev = _db.cd_proc_read_head->cd_proc_read_prev;
            row.cd_proc_read_prev->cd_proc_read_next = &row;
            row.cd_proc_read_next->cd_proc_read_prev = &row;
        } else {
            row.cd_proc_read_next = &row;
            row.cd_proc_read_prev = &row;
            _db.cd_proc_read_head = &row;
        }
        _db.cd_proc_read_n++;
        if (_db.cd_proc_read_head == &row) {
            cd_proc_read_FirstChanged();
        }
    }
}

// --- atf_exp.FDb.cd_proc_read.Remove
// Remove element from index. If element is not in index, do nothing.
void atf_exp::cd_proc_read_Remove(atf_exp::FProc& row) {
    if (cd_proc_read_InLlistQ(row)) {
        atf_exp::FProc* old_head       = _db.cd_proc_read_head;
        (void)old_head; // in case it's not used
        atf_exp::FProc *oldnext = row.cd_proc_read_next;
        atf_exp::FProc *oldprev = row.cd_proc_read_prev;
        oldnext->cd_proc_read_prev = oldprev; // remove element from list
        oldprev->cd_proc_read_next = oldnext;
        _db.cd_proc_read_n--;  // adjust count
        if (&row == _db.cd_proc_read_head) {
            _db.cd_proc_read_head = oldnext==&row ? NULL : oldnext; // adjust list head
        }
        row.cd_proc_read_next = (atf_exp::FProc*)-1; // mark element as not-in-list);
        row.cd_proc_read_prev = NULL; // clear back-pointer
        if (old_head != _db.cd_proc_read_head) {
            cd_proc_read_FirstChanged();
        }
    }
}

// --- atf_exp.FDb.cd_proc_read.RemoveAll
// Empty the index. (The rows are not deleted)
void atf_exp::cd_proc_read_RemoveAll() {
    atf_exp::FProc* row = _db.cd_proc_read_head;
    atf_exp::FProc* head = _db.cd_proc_read_head;
    _db.cd_proc_read_head = NULL;
    _db.cd_proc_read_n = 0;
    bool do_fire = (NULL != row);
    while (row) {
        atf_exp::FProc* row_next = row->cd_proc_read_next;
        row->cd_proc_read_next  = (atf_exp::FProc*)-1;
        row->cd_proc_read_prev  = NULL;
        row = row_next != head  ? row_next : NULL;
    }
    if (do_fire) {
        cd_proc_read_FirstChanged();
    }
}

