// --- atf_exp.InCase.value.SetStrptrMaybe
// Convert string to field.
// If the string is invalid, do not modify field and return false.
// In case of success, return true
bool atf_exp::value_SetStrptrMaybe(atf_exp::InCase& parent, algo::strptr rhs) {
    bool ret = false;
    switch (elems_N(rhs)) {
        case 11: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('a','m','s','.','P','r','o','c'): {
                    if (memcmp(rhs.elems+8,"Msg",3)==0) { value_SetEnum(parent,atf_exp_InCase_ams_ProcMsg); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 14: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('a','m','s','.','P','r','o','c'): {
                    if (memcmp(rhs.elems+8,"EofMsg",6)==0) { value_SetEnum(parent,atf_exp_InCase_ams_ProcEofMsg); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 15: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('a','m','s','.','P','r','o','c'): {
                    if (memcmp(rhs.elems+8,"KillMsg",7)==0) { value_SetEnum(parent,atf_exp_InCase_ams_ProcKillMsg); ret = true; break; }
                    if (memcmp(rhs.elems+8,"ReadMsg",7)==0) { value_SetEnum(parent,atf_exp_InCase_ams_ProcReadMsg); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 16: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('a','m','s','.','P','r','o','c'): {
                    if (memcmp(rhs.elems+8,"StartMsg",8)==0) { value_SetEnum(parent,atf_exp_InCase_ams_ProcStartMsg); ret = true; break; }
                    break;
                }
                case LE_STR8('a','m','s','.','T','e','r','m'): {
                    if (memcmp(rhs.elems+8,"inateMsg",8)==0) { value_SetEnum(parent,atf_exp_InCase_ams_TerminateMsg); ret = true; break; }
                    break;
                }
            }
            break;
        }
        case 20: {
            switch (algo::ReadLE64(rhs.elems)) {
                case LE_STR8('a','m','s','.','R','e','m','D'): {
                    if (memcmp(rhs.elems+8,"irRecurseMsg",12)==0) { value_SetEnum(parent,atf_exp_InCase_ams_RemDirRecurseMsg); ret = true; break; }
                    break;
                }
            }
            break;
        }
    }
    return ret;
}

