// --- atf_exp.In..DispatchRaw
int atf_exp::InDispatchRaw(atf_exp::InCase type, u8 *msg, u32 len) {
    int ret = 0;
    switch(type) {
        case 703: if (sizeof(ams::ProcEofMsg) <= len) {
            ++atf_exp::_db.trace.dispatch_In_ProcEofMsg;
            atf_exp::In_ProcEofMsg((ams::ProcEofMsg&)*msg);
            atf_exp::In_ProcEofMsg_UpdateCycles();
            ret = (int)sizeof(ams::ProcEofMsg);
        } break;
        case 704: if (sizeof(ams::ProcKillMsg) <= len) {
            ++atf_exp::_db.trace.dispatch_In_ProcKillMsg;
            atf_exp::In_ProcKillMsg((ams::ProcKillMsg&)*msg);
            atf_exp::In_ProcKillMsg_UpdateCycles();
            ret = (int)sizeof(ams::ProcKillMsg);
        } break;
        case 701: if (sizeof(ams::ProcMsg) <= len) {
            ++atf_exp::_db.trace.dispatch_In_ProcMsg;
            atf_exp::In_ProcMsg((ams::ProcMsg&)*msg);
            atf_exp::In_ProcMsg_UpdateCycles();
            ret = (int)sizeof(ams::ProcMsg);
        } break;
        case 702: if (sizeof(ams::ProcReadMsg) <= len) {
            ++atf_exp::_db.trace.dispatch_In_ProcReadMsg;
            atf_exp::In_ProcReadMsg((ams::ProcReadMsg&)*msg);
            atf_exp::In_ProcReadMsg_UpdateCycles();
            ret = (int)sizeof(ams::ProcReadMsg);
        } break;
        case 700: if (sizeof(ams::ProcStartMsg) <= len) {
            ++atf_exp::_db.trace.dispatch_In_ProcStartMsg;
            atf_exp::In_ProcStartMsg((ams::ProcStartMsg&)*msg);
            atf_exp::In_ProcStartMsg_UpdateCycles();
            ret = (int)sizeof(ams::ProcStartMsg);
        } break;
        case 633: if (sizeof(ams::RemDirRecurseMsg) <= len) {
            ++atf_exp::_db.trace.dispatch_In_RemDirRecurseMsg;
            atf_exp::In_RemDirRecurseMsg((ams::RemDirRecurseMsg&)*msg);
            atf_exp::In_RemDirRecurseMsg_UpdateCycles();
            ret = (int)sizeof(ams::RemDirRecurseMsg);
        } break;
        case 352: if (sizeof(ams::TerminateMsg) <= len) {
            ++atf_exp::_db.trace.dispatch_In_TerminateMsg;
            atf_exp::In_TerminateMsg((ams::TerminateMsg&)*msg);
            atf_exp::In_TerminateMsg_UpdateCycles();
            ret = (int)sizeof(ams::TerminateMsg);
        } break;
        default:
        ++atf_exp::_db.trace.dispatch_In_Unkmsg;
        break;
    }
    return ret;
}

// --- atf_exp.In..Dispatch
int atf_exp::InDispatch(ams::MsgHeader& msg) {
    return InDispatchRaw(atf_exp::InCase(msg.type), (u8*)&msg, i32(msg.length));
}

