// --- atf_exp...ProcMsg_FmtAppend
// Construct a new ams::ProcMsg in the space provided by BUF.
// If BUF doesn't have enough space available, throw exception.
ams::ProcMsg * atf_exp::ProcMsg_FmtAppend(algo::ByteAry &buf, const algo::strptr& proc, algo::aryptr<char > payload) {
    ams::ProcMsg  *msg = NULL;
    size_t len = sizeof(ams::ProcMsg);
    u32 payload_ary_len = elems_N(payload) * sizeof(char);
    len += payload_ary_len;
    msg = (ams::ProcMsg*)ary_AllocN(buf,len).elems;
    msg->type = u32(701);
    msg->length = u32(len + (0));
    msg->proc = proc;
    memcpy(payload_Addr(*msg), payload.elems, payload_ary_len);
    return msg;
}

